import React from 'react'

const Initializer = (plays:number,games:number,setGames:React.Dispatch<React.SetStateAction<number>>) => {
    console.log(100000)
    if (plays === 0){
        fetch("http://localhost:9091/drives",{
        method:"POST",
        headers:{"Content-Type":"application/json"},
        body: JSON.stringify({
            game_id:games
        })
    }).then(() => {
        console.log("Post initial drive!")
        setGames(prevGames => prevGames + 1)
    })}


  return null
}

export default Initializer
